import LoginView from "./LoginView";

const Authentication = App =>
  class extends React.Component {
    state = {
      loggedIn: false
    };

    componentDidMount() {
      if (localStorage.getItem("token")) {
        this.setState({ loggedIn: true });
      } else {
        this.setState({ loggedIn: false });
      }
